import Foundation
public extension CoinGecko {
    
    public struct Exchange: Codable {
        public var name: String?
        var year_established: Int?
        var country: String?
        var description: String?
        var url: String?
        var image: String?
        var facebook_url: String?
        var reddit_url: String?
        var telegram_url: String?
        var slack_url: String?
        var other_url_1: String?
        var other_url_2: String?
        var twitter_handle: String?
        var has_trading_incentive: Bool?
        var centralized: Bool?
        var public_notice: String?
        var alert_notice: String?
        var trust_score: Int?
        var trust_score_rank: Int?
        var trade_volume_24h_btc: Double?
        var trade_valume_24h_btc_normalized: Double?
        var tickers: [Ticker]?
//        var status_update: [[String: Any]]?
        public static func get() async -> [Exchange] {
            if let networks: [Exchange] = try? await CoinGecko.exchangesList.getObject() {
                return networks
            }
            return []
        }

    }
    
    static func listExchange(){
        Task{
            if let networks: [Exchange] = try? await CoinGecko.exchangesList.getObject() {
                
                networks.forEach {
                    print($0.name ?? "")
                }
            }
        }
    }
 
}
